using namespace std;

int calDigitDiffCount(int left , int right){
    int count = 0;
    while(left != 0){
        int maskLeft = (left / 10) * 10;
        int digitLeft = left - maskLeft;

        int maskRight = (right / 10) * 10;
        int digitRight = right - maskRight;
        
        // cout << "leftdigit " << digitLeft << endl;
        // cout << "rightDigit " << digitRight << endl;

        if(digitLeft != digitRight){
            count++;
        }

        left = left / 10;
        right = right / 10;
    }//end while
    return count;
}

void findDigitValues(int value , vector<int> &digitValues){
    digitValues.clear();
    while(value != 0){
        int maskValue = (value / 10) * 10;
        int digit = value - maskValue;
        digitValues.push_back(digit);
        value = value / 10;
    }//end while
}

int digitDiffCount(int left , int right, vector<int> &leftVec, vector<int> &rightVec){
    findDigitValues(left , leftVec);
    findDigitValues(right , rightVec);

    int diffCount = 0;
    if(leftVec.size() == rightVec.size()){
        for(int i = 0 ; i < leftVec.size() ;i++){
            if(leftVec[i] != rightVec[i]){
                diffCount++;
            }
        }//end for i
    }
    return diffCount;
}

long long sumDigitDifferences3(vector<int>& nums){
    long long total = 0;
    const int size = nums.size();
    vector<int> leftVec;
    vector<int> rightVec;
    for(int i = 0 ; i < size ; i++){
        int leftValue = nums[i];
        for(int j = i + 1; j < size; j++){
            int rightValue = nums[j];
            int count = digitDiffCount(leftValue , rightValue , leftVec, rightVec);
            total += count;
        }
    }//end for i
    return total;
}

long long sumDigitDifferences(vector<int>& nums) {
    unordered_map<int , int> numsMap;
    for(int num : nums){
        if(numsMap.find(num) == numsMap.end()){
            numsMap[num] = 1;
        }else{
            int count = numsMap[num] + 1;
            numsMap[num] = count;
        }
    }//end for each

    vector<int> subNumArray;
    for(auto &p : numsMap){
        subNumArray.push_back(p.first);
    }//end for each

    unordered_map<int, int> digitDiffMap;
    const int size = subNumArray.size();
    // cout << "origin array :" << nums.size() << "   subNumArray : " << subNumArray.size() << endl;
    vector<int> leftVec;
    vector<int> rightVec;
    for(int i = 0 ; i < size ; i++){
        int diff = 0;

        int leftValue = subNumArray[i];
        for(int j = i + 1; j < size; j++){
            int rightValue = subNumArray[j];
            // int count = digitDiffCount(leftValue , rightValue , leftVec , rightVec) * numsMap[rightValue];
            int count = calDigitDiffCount(leftValue , rightValue) * numsMap[rightValue];
            diff += count;
        }
        digitDiffMap[leftValue] = diff;
    }//end for i

    long long total = 0;
    for(auto &p : numsMap){
        int value = p.first;
        int perCount = digitDiffMap[value];
        int digitCount = p.second;
        total += (perCount *digitCount); 
    }//end for each
    return total;
}

